import ActionsBlacklist from "./blacklist/ActionsBlacklist.js";
import ActionsDefault from "./default/ActionsDefault.js";
export default {
  props: {
    actions: {
      type: Array,
      required: true
    },
    route: {
      type: String,
      required: true
    },
    members: {
      type: Array,
      required: true
    },
    membersFound: {
      type: Number,
      required: true
    },
    membersPage: {
      type: Number,
      required: true
    },
    membersPagesCount: {
      type: Number,
      required: true
    },
    blacklistType: {
      type: String,
      required: true
    }
  },
  render(h) {
    if (this.route === 'actions/blacklist') {
      return h(ActionsBlacklist, {
        key: 'ranks/edit',
        props: {
          members: this.members,
          membersFound: this.membersFound,
          membersPage: this.membersPage,
          membersPagesCount: this.membersPagesCount,
          blacklistType: this.blacklistType
        }
      });
    } else {
      return h(ActionsDefault, {
        key: 'actions',
        props: {
          actions: this.actions
        }
      });
    }
  }
};
